import {MdSearch} from 'react-icons/md'

function Search() {
  return (
    <div className='search'>

        <MdSearch className='searcch-icons' size='1.3em'/>
    <input type='text'
    className='search input'
    placeholder='type to search...' />

    </div>
  )
}

export default Search
